const IMAGES = {
    card: require("../assets/images/card.png").default,
    error404: require("../assets/images/error404.png").default,
    extract: require("../assets/images/extract.png").default,
    help: require("../assets/images/help.png").default,
    home: require("../assets/images/home.png").default,
    globe: require("../assets/images/globe.png").default,
    leaf: require("../assets/images/leaf.png").default,
    logo: require("../assets/images/logo.png").default,
    piggy_bank: require("../assets/images/piggy-bank.png").default,
    save_money: require("../assets/images/save-money.png").default,
    search: require("../assets/images/search.png").default,
    transfer: require("../assets/images/transfer.png").default,
    user: require("../assets/images/user.png").default,
    wallet: require("../assets/images/wallet.png").default,
};

const GIFS = {
    loading_buffering: require("../assets/gifs/loading-buffering.png").default,
};

const ASSETS = {
    IMAGES,
    GIFS,
};

export default ASSETS;
